import React from "react";
import styled from "styled-components";

const StyledCountdown = styled(Countdown)`
  text-align: center;
  color: ${props => props.theme.primary};
  position: absolute;
  top: 50%;
  left: 50%;
`

const Countdown = () => (
  <div>Countdown</div>
)

export default Countdown
